local function toolTipOverride(e)
	if not e.reference then
		return
	end
	if not e.reference.data then
		return
	end
	if not e.reference.data.rngName then
		return
	end
	local label = e.tooltip:findChild(tes3ui.registerID("HelpMenu_name"))
	label.text = e.reference.data.rngName
end

local function dialogueOverride(e)
	local actor = tes3ui.getServiceActor()
	if not actor then
		return
	end
	local ref = actor.reference
	local title = e.element:findChild("PartDragMenu_title")
	local name =  ref.data.rngName or title.text
	title.text = name
end

local function onBodyPartAssigned(e)
	if (e.reference == tes3.player) or (e.mobile == tes3.mobilePlayer) then
		return
	end
	if (raceTable[e.reference.baseObject.race.id:lower()] == nil) then
		return
	end
	if (e.index ~= tes3.activeBodyPart.head) and (e.index ~= tes3.activeBodyPart.hair) then
		return
	end

	if e.object then
		if e.object.objectType == tes3.objectType.armor and e.object.slot == tes3.armorSlot.helmet then
			if e.bodyPart.part == parts.head then
				return
			elseif e.bodyPart.part == parts.hair then
				return
			end
		end
	end

	if (e.bodyPart.vampiric == true) then
		return
