local function initialized()
	event.register("mobileActivated", onMobileActivated)
	event.register("uiObjectTooltip", toolTipOverride)
	event.register("uiActivated", dialogueOverride, {filter = "MenuDialog"})
	event.register("bodyPartAssigned", onBodyPartAssigned)
	print("[F&F Random Names&Faces] Mod initialized!")
	westly_enabled = tes3.isModActive("Westly's Master Headpack X.esp")
	if westly_enabled then
		print("[F&F Random Names&Faces] Westly's Headpack Found!")
	end
end

event.register("initialized", initialized)

-- MCM --

local resetConfig = false

local function modConfigReady()

	local template = mwse.mcm.createTemplate("F&F - Random Names&Faces")

	template.onClose = function()
		if resetConfig then
			resetConfig = false
			config = default_config
		end
		mwse.saveConfig(config_name, config, {indent = false})
	end

	local page = template:createSideBarPage({
		label = "Settings",
		description = [[
		Friends and Foes - Random Names and Faces settings.
		If you don't have Westly's Master Headpack X.esp enabled, will automatically use only vanilla faces and hair. 
		]]
	  })
	
	local main_settings = page:createCategory("Main Settings")

	main_settings:createOnOffButton{
		label = "Enable Random Names",
		description = "Assign random names to most F&F NPCs. Note that some (like Deserter, Bounty Hunter, companion NPCs) are excluded from this to keep them recognizable.",
